   "source": [
    "hist_mpg <- ggplot(data = auto, aes(x = mpg)) +\n",
    "  geom_histogram(color = \"darkblue\", fill = \"lightblue\") +\n",
    "  labs(title = \"Miles Per Gallon Histogram Plot\", x = \"Miles Per Gallon\", y = \"Count\") +\n",
    "  theme_light()\n",
    "\n",
    "box_mpg <- ggplot(data = auto, aes(x = mpg)) +\n",
    "  geom_boxplot(color = \"darkblue\", fill = \"lightblue\") +\n",
    "  labs(title = \"Miles Per Gallon Box Plot\", x = \"Miles Per Gallon\", y = \"Count\") +\n",
    "  theme_light()\n",
    "\n",
    "hist_mpg + box_mpg"
   ]
