   "source": [
    "hist_horse <- ggplot(data = auto, aes(x = horsepower)) +\n",
    "  geom_histogram(color = \"darkblue\", fill = \"lightblue\") +\n",
    "  labs(title = \"horsepower Histogram Plot\", x = \"horsepower\", y = \"Count\") +\n",
    "  theme_light()\n",
    "\n",
