    "  geom_boxplot(color = \"darkblue\", fill = \"lightblue\") +\n",
    "  labs(title = \"horsepower Box Plot\", x = \"horsepower\", y = \"Count\") +\n",
    "  theme_light()\n",
    "\n",
    "hist_horse + box_horse"
   ]
