    "  geom_boxplot(color = \"darkblue\", fill = \"lightblue\") +\n",
    "  labs(title = \"model year Box Plot\", x = \"model year\", y = \"Count\") +\n",
    "  theme_light()\n",
    "\n",
    "hist_modyear + box_modyear"
   ]
