    "set.seed(123)\n",
    "auto_split <- initial_split(auto, prop = 0.80)\n",
    "auto_split\n",
    "\n",
    "auto_train <- training(auto_split)\n",
    "auto_test  <- testing(auto_split)\n",
    "\n",
    "auto_cv <- vfold_cv(auto_train, v = 10)"
   ]
