    "model_recipe <- \n",
    "  recipe(mpg ~ ., data = auto_train) %>%\n",
    "  step_impute_median(horsepower) %>% # median imputation (horsepower variable)\n",
    "  step_impute_mode(`car name`) %>% # mode imputation (car name variable)\n",
    "  step_other(`car name`, cylinders) %>% # encoding\n",
    "  step_dummy(`car name`, cylinders, origin, one_hot = TRUE) %>% # one hot encoding\n",
    "  step_log(displacement, horsepower, weight) %>% # logarithmic transformation\n",
    "  step_zv(all_predictors()) # zero variance remove variable"
   ]
